import * as React from 'react'
import Title from './components/title_bar'
import Navbar from './components/nav_bar'
import './pageTwo.css'

export default function Objectives(){

    const [Lang,SetLang] = React.useState('EN');

    let LangEN,LangDE;

    if(Lang === 'EN'){
        LangEN = 'block'
        LangDE = 'none'
    } else if (Lang === 'DE'){
        LangDE='block'
        LangEN='none'
    }

return(
    <div>
        <Title/>

        <Navbar onUpdate = {(value:string) => SetLang(value)} pg_Objectives='4px solid red'/>

        <div className='txt_box'>


        </div>

    </div>

)

}
